import React, { useEffect } from 'react'

const Login = () => {

    useEffect(() => {
        document.title = "Skill choosing";
    }, [] );

    return (
        <div className='main-text'>
            <h1>Login form!</h1>
            <form action="">
                <label>Enter name:</label>
            </form>

        </div>
    );
}

export default Login;
